import React, { Component } from 'react';
import FoodMenu from '../Assets/JSON/FoodMenu.json';

class CardMenu extends Component{

  componentWillMount() {
    this.setState({
      foodMenu: FoodMenu
    })
  }

  render() {


    return (

      <div className="flip-menu-card">
        <div className="flip-menu-card-inner">
          <div className="flip-menu-card-front">
          </div>
          <div className="flip-menu-card-back">
            {this.state.foodMenu.FoodMenus.map((menu, index) => {
            console.log(menu);
            return ( 
              <div>
                <h3>{menu.title}</h3>
                <p>Pris: {menu.price}</p>
              </div>
            )
           })}

          </div>
        </div>
      </div>

      )
  }
} 

export default CardMenu;
